import { useEffect, useState } from 'react';
import ActivityList from './ActivityList';
import useFetch from './useFetch';
import { Link } from 'react-router-dom';


const Activities = () => {
    const { data: Alldata, isPending, error } = useFetch("https://developer.nps.gov/api/v1/activities/parks?&limit=1000&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE");
    //console.log(Alldata);
    //console.log(parks);
    //const parks = data;
    //const [Activities, setActivities] = useState([]);

    /*const handleActivitySearch = (activity) => {
        const newParks = parks.filter(park => park.activities !== activity);
        setParks(newParks);
    }*/


    return (  
        <div className="home">
        <h2>Activities</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            {data && (data.map(function(activity, idx){
                <Link to={`/Activities/${activity.id}`}> <li key={idx}>{activity.id}</li>
                <ActivityList activityId={activity.id} activityName={activity.name} activityParks={activity.parks}/>
                </Link>
            }))}
        </div>
    );
    return (  
        <div className="ParksList">
        <h2>All Parks</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { parks && <Parks parks={parks.data} /> }
        </div>
    );
}

export default Activities;
